import axios from 'axios';

const api = 'https://api.elrond.com';
const http = axios.create({
  baseURL: api,
  headers: {
    'Content-type': 'application/json'
  }
});
const collection = 'EQUISTAR-3f393f';

export const NbNftsMint = async () => {
  try {
    const { data } = await http.get('/nfts/count?collection=' + collection);
    return {
      data: data,
      success: true
    };
  } catch (err) {
    return {
      data: err.response.data,
      success: false
    };
  }
};

export const fetchEstarWallet = async () => {
  try {
    const { data } = await http.get('/accounts/' + collection);
    return {
      data: data,
      success: true
    };
  } catch (err) {
    return {
      data: err.response.data,
      success: false
    };
  }
};
